import React from 'react';
import { Text, View } from "react-native"


const WelcomeScreen = (props: any) => {
    const { x, y, person } = props;
    const { name, age, email } = person;
    return (
        <View>
            <Text>X: {x} and Y: {y}</Text>
            <Text></Text>
        </View>
    )
}

export default WelcomeScreen
